    bool paused = false;

    //Staking Variables
    uint256 public totalNftStaked = 0;
    mapping(address => uint256) private _balances;
    mapping(address => uint256) public lastClaimTime;

    //Collection Variables
    IERC721 public nft;
    uint256 public STAKINGREWARD = 240 ether;
    uint256 public STAKINGREWARD_1to1 = 1000 ether;
    mapping(uint256 => address) public tokenIdOwners;
    mapping(address => uint256) public numberTokensStaked;
    mapping(address => uint256) public number1to1TokensStaked;
    mapping(address => mapping(uint256 => uint256)) public ownerTokenIds;

    uint256[] list_of_1to1s = [
        60,
        117,
        137,
        253,
        351,
        508,
        558,
        571,
        587,
        613,
        711,
        773,
        826,
