        945,
        972,
        990,
        996,
        1000,
        1107,
        1227,
        1285,
        1334,
        1430,
        4659,
        1960,
        2083,
        2353,
        2753,
        2754,
        2862,
        2928,
        3382,
        3545,
        3612,
        4231,
        4496,
        5196,
        5433
    ];

    modifier updateReward(address account) {
        uint256 reward = getRewards(account);
        lastClaimTime[account] = block.timestamp;
        _balances[account] += reward;
        _;
    }
    mapping(address => bool) public allowedList;
    modifier onlyFutureAdmin() {
        require(
            allowedList[_msgSender()],
            "Ownable: caller is not the Allowed"
        );
        _;
    }

    constructor(address _nftAddress) {
        nft = IERC721(_nftAddress);
    }

    function editAllowList(address val, bool permission) public onlyOwner {
        allowedList[val] = permission;
    }

    function addPoints(address _to, uint val) public onlyFutureAdmin {
        require(val > 0, "Value cannot be zero.");
        _balances[_to] = _balances[_to] + val;
    }

    function removePoints(
        address _to,
        uint val
    ) public updateReward(_to) onlyFutureAdmin {
        require(
            _balances[_to] >= val,
            "Deduction amount should be greater than balance."
        );
        _balances[_to] = _balances[_to] - val;
    }

    function is_1to1(uint num) public view returns (bool) {
        for (uint i = 0; i < list_of_1to1s.length; i++) {
            if (list_of_1to1s[i] == num) {
                return true;
            }
        }
        return false;
    }

    //Setter Functions
    function set_Staking_Reward_In_Wei(uint256 val) public onlyOwner {
        STAKINGREWARD = val;
    }

    function setNftAddress(address val) public onlyOwner {
        nft = IERC721(val);
    }

    function getPerDayLegendayRewards(
        address account
    ) public view returns (uint256) {
        uint legendary_reward = number1to1TokensStaked[account] *
            STAKINGREWARD_1to1;
        return legendary_reward;
    }

    function rewardsPerDay(address account) public view returns (uint256) {
        uint cRewards = (numberTokensStaked[account]) * STAKINGREWARD;
        uint legendary_reward = getPerDayLegendayRewards(account);
        uint256 totalReward = cRewards + legendary_reward;
        return totalReward;
    }

    function getRewards(address account) internal view returns (uint256) {
        uint cRewards = (numberTokensStaked[account]) * STAKINGREWARD;
        uint legendary_reward = getPerDayLegendayRewards(account);
        uint256 totalReward = cRewards + legendary_reward;

        uint256 _lastClaimed = lastClaimTime[account];
        return totalReward.mul(block.timestamp.sub(_lastClaimed)).div(86400);
    }

    function viewRewards(address account) public view returns (uint256) {
        // Total Earned Rewards
        uint256 pendingReward = getRewards(account);
        return pendingReward + _balances[account];
    }

    function getUserstakedNftIds(
        address _user
    ) public view returns (uint256[] memory) {
        uint256 len = numberTokensStaked[_user] + number1to1TokensStaked[_user];
        uint256[] memory temp = new uint[](len);
        for (uint256 i = 0; i < len; ++i) {
            temp[i] = ownerTokenIds[_user][i];
        }
        return temp;
    }

    function stakeNfts(
        uint256[] calldata tokenIds
    ) external updateReward(msg.sender) nonReentrant {
        require(!paused, "Contract is paused");
        require(
            IERC721(nft).isApprovedForAll(msg.sender, address(this)),
            "Approve Nfts First"
        );
        require(tokenIds.length > 0, "0 Nfts to Stake");

        unchecked {
            uint256 len = tokenIds.length;
            uint256 numStaked = numberTokensStaked[msg.sender];
            uint256 num_1to1_staked = number1to1TokensStaked[msg.sender];
            uint256 total_Staked_by_user = numStaked + num_1to1_staked;
            for (uint256 i = 0; i < len; i++) {
                uint256 tokenId = tokenIds[i];
                require(
                    IERC721(nft).ownerOf(tokenId) == msg.sender,
                    "You are not owner of this nft."
                );

                if (is_1to1(tokenId)) {
                    num_1to1_staked++;
                } else {
                    numStaked++;
                }
                tokenIdOwners[tokenId] = msg.sender;
                ownerTokenIds[msg.sender][total_Staked_by_user] = tokenId;
                total_Staked_by_user++;
                totalNftStaked++;
                nft.transferFrom(msg.sender, address(this), tokenId);
            }
            numberTokensStaked[msg.sender] = numStaked;
            number1to1TokensStaked[msg.sender] = num_1to1_staked;
        }
    }

    function unstakeNfts(
        uint256[] calldata tokenIds
    ) external updateReward(msg.sender) nonReentrant {
        require(!paused, "Contract is paused");
        require(tokenIds.length > 0, "0 Nfts to Stake");

        uint256 len = tokenIds.length;

        for (uint256 i = 0; i < len; i++) {
            uint256 tokenId = tokenIds[i];

            require(
                tokenIdOwners[tokenId] == msg.sender,
                "You dont own this ID"
            );
            require(
                IERC721(nft).ownerOf(tokenId) == address(this),
                "Nft not available in the contract"
            );
            removeFromUserStakedTokens(msg.sender, tokenId);

            if (is_1to1(tokenId)) {
                number1to1TokensStaked[msg.sender]--;
            } else {
                numberTokensStaked[msg.sender]--;
            }
            totalNftStaked--;
            delete tokenIdOwners[tokenId];
            nft.transferFrom(address(this), msg.sender, tokenId);
        }
    }

    function togglePause() public onlyOwner {
        paused = !paused;
    }

    function removeFromUserStakedTokens(
        address user,
        uint256 tokenId
    ) internal {
        uint256 _numStaked = numberTokensStaked[user];
        uint256 _1to1numStaked = number1to1TokensStaked[user];

        uint256 totalnum = _1to1numStaked + _numStaked;

        for (uint256 j = 0; j < totalnum; ++j) {
            if (ownerTokenIds[user][j] == tokenId) {
                uint256 lastIndex = totalnum - 1;
                ownerTokenIds[user][j] = ownerTokenIds[user][lastIndex];
                delete ownerTokenIds[user][lastIndex];
                break;
            }
        }
    }
}

